import React from 'react';
import './Form.css';

class Form extends React.Component
{
// Simple Form

    render()
    {
        return (
            <>
              <div className = "Form-Element">

               <label>
                   Title
               </label>
                   <input type="text" name="name" />

               <input type="submit" className="submit" value="Submit" />
       </div>
       <div className = "Form-Result">
          <h2>Hello</h2>
        </div>
       </>

        );
    }
}
export default Form;
